import Weekday from "../Weekday/Weekday";

export default function Calendar() {
  const weekdayshort = moment.weekdaysShort();

  let weekday = weekdayshort.map((day) => {
    return <th key={day}>{day}</th>;
  });

  return (
    <div>
      weekday
      <h2>Calendar</h2>
    </div>
  );
}
